export class Collision{static between(t,h){return t!==h&&t.x+t.width>=h.x&&t.x<=h.x+h.width&&t.y+t.height>=h.y&&t.y<=h.y+h.height}static deny(t,h){if(!this.between(t,h)||t===h)return;const i=5*(Math.min(t.x+t.width,h.x+h.width)-Math.max(t.x,h.x)),x=5*(Math.min(t.y+t.height,h.y+h.height)-Math.max(t.y,h.y));i<x?t.x<h.x?t.x-=i:t.x+=i:t.y<h.y?t.y-=x:t.y+=x}}